l_english:
roc_random.8.t:0 "Corrupt officials"
roc_random.8.d:0 "Several important people in the government have been doing all sorts of tricky immoral acts and using money to cover it up, or using money supposed to go to public works for their own personal gain. We go through and undo this, but it will cause instabality in the short term. Or we can give them a slap on the wrist, but the lack of punishment will encourage this sort of behavior, and all the money that went along with it will cause short term inflation."
roc_random.8.a:0 "Punish the official!"
roc_random.8.b:0 "Give them a slap on the wrist."
ABC_ideas: "Babylonian Ideas"
ABC_ideas_start: "Babylonian Traditions"
ABC_ideas_bonus: "Babylonian Ambition"
cradle_of_humanity: "Cradle of Humanity"
cradle_of_humanity_desc: "Mesopotamia is home to one of the first civilization of man, despite what the Egyptians may claim... we have been building up and developing the land since we first arrived here in this great land between the rivers!"
envied_land: "Envied Land"
envied_land_desc: "Our fertile paradise is envied by our neighbors to the west and east... building our forts to a higher standard is a must"
babylonian_archers: "Babylonian Archers"
babylonian_archers_desc: "Babylon is famed for elite archery, thousands of years before nations like England. Whatever ranged weapons we muster against the enemy expert babylonian marksmen will always give them a bit of an extra punch..."
middle_realm: "Middle Realm"
middle_realm_desc: "Babylonia sits in the middle between many realms, we can easily use this to our advantage and convince our neighbors to align to our way of thinking much easier"
first_nation: "First Nation"
first_nation_desc: "Babylonia is truly the first nation, don't let anyone ever tell us otherwise we hold the glory of that crowning acheivement! While not the first empire, even in Mesopotamia, Babylon is a center of cuture stability that united with it's influence the region."
steadfast_army: "Steadfast Army"
steadfast_army_desc: "Babylonia is surrounded by dangerous neighbors, we need a steadfast army that won't easily break when confronted by Egyptian Chariots, or Iranian Cataphracts!"
center_of_technology: "Center of Learning"
center_of_technology_desc: "Babylon's culture and learning is renowned, it's culture and technology influences the entire region and unites it. Nations all over the world will know of the name Babylon."
AIC_ideas: "Indian Ideas"
AIC_ideas_start: "Indian Traditions"
AIC_ideas_bonus: "Indian Ambition"
indus_trade: "Indus Trade"
indus_trade_desc: "We've been blessed to have our home be rich in desirable goods such as spices, silk and more many other nations are interested and have come a long way to get their hands on our products!"
flexible_military: "Flexible Military"
flexible_military_desc: "Our military is more flexible then other nations, we can afford to raise and maintain large formations much easier then most all it takes is a few benefits here and there!"
urbanized_tax_code: "Urbanized Tax Code"
urbanized_tax_code_desc: "Thanks to our urban planning and the fact that we're one of the best urbanizers out there we've got a lot of potential to make a lot of money... now let's ensure everyone pays their fair share."
spice_silk: "Spice and Silk"
spice_silk_desc: "Spices and silk two glorious things vital to our economy we need to ensure we're meeting the demand of those who eagerly wish to purchase them, because foreigners come from long distances from the West to buy our goods."
land_of_faith: "Land of Faith"
land_of_faith_desc: "India is a land of many important major Religions, such as Buddhism Hinduism and Jainism."
feed_the_people: "Farming Initiative"
feed_the_people_desc: "India has many people, and it is imperative we keep them well-fed for continued growth."
adaptable_army_command: "Adaptable Command"
adaptable_army_command_desc: "Those who don't learn from war are doomed to be destroyed...."
AEC_ideas: "Egyptian Ideas"
AEC_ideas_start: "Egyptian Traditions"
AEC_ideas_bonus: "Egyptian Ambition"
granary_mediterranean: "Granary of the Mediterranean"
granary_mediterranean_desc: "Egypt's fertile delta is known far and wide to produce an enviable amount of grain and luxurious Egyptian cotton"
professional_army: "Professional_army"
professional_army_desc: "Our nation is one of the very first to field a properly professional army of standing soldiers, giving Egypt the edge against most other nations."
pyramid_builders: "Pyramid Builders"
pyramid_builders_desc: "What other country could build something as exceptionally marvelous as the Great Pyramids themselves? No one, Egypt is home to some of the finest designers and builders in the world!"
red_sea_trade_fleet: "Red Sea Trade Fleet"
red_sea_trade_fleet_desc: "Trade from the far east flows towards the eager customers of Europe and the middle east thanks to the guidance of our trade fleets."
desert_realm: "Desert Realm"
desert_realm_desc: "When your realm is surrounded by the desert on almost every side you learn a thing or two about how to combat the sweltering heat and harsh conditions that would put most armies into the grave"
continuity: "Continuity"
continuity_desc: "Life, Death, Rebirth. This is the motto of Egypt. Egyptian Continuity is as sure as the nile's yearly floods, a stable and safe life for all under our reign ensures we don't collapse so easily."
great_chariots: "Great Chariots"
great_chariots_desc: "Egyptian Chariots are as deadly as they are glorious, pulled by two horses they cut down or trample anything that stands before them"
ACC_ideas: "Chinese Ideas"
ACC_ideas_start: "Chinese Traditions"
ACC_ideas_bonus: "Chinese Ambition"
chinese_bureaucracy: "Chinese Bureaucracy"
chinese_bureaucracy_desc: "While other nations may struggle to govern their lands, this isn't an issue for us our Bureaucrats keep China running smoothly.... for the most part." 
sinicization: "Sinicization"
sinicization_desc: "Throughout history China has expanded slowly yet surely through Sinicization, barbarians become integrated into our culture so they can be protected from barbarians!" 
china_river: "Taming the China River"
china_river_desc: "China's rivers are prone to being... unpredictable but they can be a great source of prosperity and wealth once we properly tame them and use them to feed the rest of the nation!"
stand_firm: "Stand Firm"
stand_firm_desc: "Outside barbarians reguarlly threaten us and our vary way of life, we have learned to stand firm and better resist the invader!"
mandate_of_heaven: "Mandate of Heaven"
mandate_of_heaven_desc: "The Mandate of Heaven is the divine responsbility of our Emperors to ensure the continued prosperity and integerity of the celstial Empire."
celestial_envoy: "Celestial Envoys"
celestial_envoy_desc: "The Celestial envoys will be given proper escort and transportation to ensure the Emperor's will is carried out in a timely fashion."
tributary_benefits: "Tributary Benefits"
tributary_benefits_desc: "Being a tributary of China has it's benefits..."
